import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
position: absolute;
height: 120px;
left: 0px;
right: 0px;
top: 0px;

background: rgba(255, 255, 255, 0.96);
`
const Wrapper=styled.div`
position: absolute;
width: 1120px;
height: 50px;
left: calc(50% - 1120px/2);
top: calc(50% - 50px/2);
display:flex;
justify-content: space-between;
`
const Left=styled.div`
position: absolute;
width: 97px;
height: 32px;
left: calc(50% - 97px/2);
top: calc(50% - 32px/2);
`
const Center=styled.div`
position: absolute;
width: 323.06px;
height: 32px;
left: 398.47px;
top: calc(50% - 32px/2);
`
const Right=styled.div`
`
const Navbar = () => {
  return (
    <Container>
      <Wrapper>
        <Left>left</Left>
        <Center>right</Center>
        <Right></Right>
      </Wrapper>
    </Container>
  )
}

export default Navbar
